import React from 'react'
import './Person.css'
const Preson = (arg)=> {
return (<div className="Person_css">
        <p onClick={arg.click1} >hello {arg.name} and your age is {arg.age} coming from person.js {arg.children}</p>
    </div>)
};

export default Preson;
